import React from "react";

function Navbar() {
  const navStyle = {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    backgroundColor: "#0052cc",
    padding: "10px 20px",
    color: "white",
    position: "fixed",
    top: 0,
    width: "100%",
    zIndex: 1000,
  };

  const linkStyle = {
    color: "white",
    marginLeft: 20,
    textDecoration: "none",
    cursor: "pointer",
    fontWeight: "bold",
  };

  return (
    <nav style={navStyle}>
      <div style={{ fontWeight: "bold", fontSize: 18 }}>PM Internship Scheme</div>
      <div>
        <a href="#" style={linkStyle}>Registration</a>
        <a href="#" style={linkStyle}>Login</a>
        <a href="#" style={linkStyle}>Partner Companies</a>
        <a href="#" style={linkStyle}>Opportunities ▼</a>
        <a href="#" style={linkStyle}>News ▼</a>
      </div>
    </nav>
  );
}

export default Navbar;
